import React from 'react';

function Filter() {

	return(
		<nav className='filter'>
			Filter items:
			<ul>
				<li>All</li>
				<li>Web</li>
				<li>Branding</li>
				<li>Graphic</li>
			</ul>
		</nav>
	);
}

export default Filter;
